import React from 'react';
import styled from 'styled-components/macro';


export let Panes = styled.div({
    display: 'flex',
    width: '100vw',
    height: '100vh'
});

  
export let Pane = styled.div(props => ({
    overFlow: 'auto',
    ...props
}));
